column8:
中・大型犬が満足できるように太く、かために仕上げた歯ブラシガムに鶏ササミを巻いた嗜好性の高いスナックです。噛むことで繊維構造が歯に食い込み、ニオイと歯垢がスッキリ！歯のための食品素材「ＰＯｓ－ＣａR」を配合。<br>【原材料】<br>肉類（牛皮、鶏ササミ等）、豆類、油脂類、リン酸化オリゴ糖カルシウム（ＰＯｓ－ＣａR）、リンゴ抽出物、ビタミン類（Ｅ）、増粘安定剤（加工デンプン）、保存料（ソルビン酸カリウム、デヒドロ酢酸ナトリウム）<br>【保証成分】<br>たん白質・・・61.9％以上、脂質・・・0.8％以上、繊維質・・・1.0％以下、灰分・・・4.0％以下、水分・・・18.0％以下<br>【原産国または製造地】<br>中国<br><P><IMG src=http://image.rakuten.co.jp/kenkoubin/cabinet/shohin01/img57848625.jpg width=259 height=79 border=0><BR></P><!--縦バナー-->

